import React from 'react';
import Image from 'src/images/background.png';
import { COLLATERAL_TOKENS } from "src/config"
import { EarnEntry } from "src/pages/Earn/EarnEntry"; 
import { css } from '@emotion/react';
import {
  Container, 
  Title, 
  Description,
  Wrapper, 
  Background,
  CardContainer,
} from "src/components/MainPages";
import { SimpleTable } from 'src/components/SimpleTable';

const Earn = () => {
  return (
    <Flex sx ={{}} >
      <Container>
        <Title>Earn</Title>
        <Description>Lend assets for the highest yield.</Description>
      </Container>
      <CardContainer>
        {/* <InfoContainer> */}
        <SimpleTable>
          <thead>
            <tr>
              <th
                css={css`
                  text-align: left !important;
                `}
              >
                Asset
              </th>
              <th>APY</th>
              <th>Total Supply</th>
              <th>Total Borrow</th>
              <th>Utilization</th>
              <th>Balance</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {COLLATERAL_TOKENS.map((token) => (
              <EarnEntry key={token.address} token={token}/>
            ))}
          </tbody>
        </SimpleTable>
        {/* </InfoContainer> */}
      </CardContainer>
      <Background src={Image} alt='Background Logo' />
    </Flex>
  );
};

export default Earn;
